import React from "react";
import "../styles.css";

export default function UrlList({ urls }) {
  if (!urls || urls.length === 0) {
    return <p className="empty-msg">No URLs shortened yet ðŸš€</p>;
  }

  return (
    <div className="url-list">
      {urls.map((u) => (
        <div key={u.id} className="url-card">
          <h3 className="short-url">ðŸ”— {u.shortUrl}</h3>
          <p>
            <strong>Original:</strong>{" "}
            <a href={u.originalUrl} target="_blank" rel="noreferrer">
              {u.originalUrl}
            </a>
          </p>
          <p>
            <strong>Expires At:</strong> {u.expiry}
          </p>
          <p>
            <strong>Clicks:</strong> {u.clicks.length}
          </p>
        </div>
      ))}
    </div>
  );
}
